func leftmostBuildingQueries(heights []int, queries [][]int) []int {
    n := len(heights)
    ans := make([]int, len(queries))
    for i, q := range queries {
        a, b := q[0], q[1]
        if a > b {
            ans[i] = -1
            continue
        }
        meet := -1
        maxLeft := heights[a]
        for j := a + 1; j <= b && j < n; j++ {
            if heights[j] > maxLeft {
                if meet == -1 || j < meet {
                    meet = j
                }
                maxLeft = heights[j]
            }
        }
        if meet != -1 {
            maxRight := heights[b]
            for j := b - 1; j > meet; j-- {
                if heights[j] > maxRight {
                    meet = -1
                    break
                }
                maxRight = max(heights[j], maxRight)
            }
        }
        ans[i] = meet
    }
    return ans
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
